import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";

function App() {
    return <Card />;
}

function Card() {
    return (
        <div className="card">
            <Avatar />
            <Content />
            <Lang />
        </div>
    );
}

function Avatar() {
    return <img src="./assets/image/dd.jpg" alt="" />;
}

function Content() {
    return (
        <div>
            <h2>John Doe</h2>;
            <p>Frontend Developer</p>;
            <p>London</p>;
            <p>React</p>;
            <p>JavaScript</p>;
            <p>HTML/CSS</p>;
            <p>Python</p>;
        </div>
    )
}

function Lang() {}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
    <React.StrictMode>
        <App />
    </React.StrictMode>
);
